import Navbar from "./Navbar"
import Head from 'next/head'

const Layout = (props) => {
  return (
    <div>
        <Head>
            <title>MyNextAPp</title>
            <link rel="stylesheet" href="./boostrap.min.css" />
        </Head>

    <Navbar />

    {props.children}

    </div>
  )
}

export default Layout
